export const Users = (state = {}, action) => {
    switch (action.type) {
        case 'ADD_USERS':
            return {
                ...state,
                users: action.users
            };
        default:
            return state;
    };
};

export const About = (state = {}, action) => {
    switch (action.type) {
        case 'ADD_ABOUT':
            return {
                ...state,
                about: action.about
            };
        default:
            return state;
    };
};
